import './App.css';
import React, { Component } from 'react';
import Nav from './components/Nav';
import Search from './components/Search';
import PortfolioCard from './components/PortfolioCard';
import portfolioDB from './DB/portfolioDB';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      users: [
        {
          id: null,
          name: '',
          school: '',
          major: '',
          Year: null,
          Portfolio: [{ img: [], desc: '' }],
        },
      ],
    };
  }
  render() {
    return (
      <div className="App">
        <Nav />
        <Search />
        <div className="Card-grid-wrapper">
          <PortfolioCard
            className="Card-grid"
            mainImg="https://images.unsplash.com/photo-1551732998-9573f695fdbb?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1650&q=80"
            school="California College of the Arts"
            major="Illustration"
            userName="Chance Lipshutz"
            year="2020"
          />
